function VscoLoader({saves}) {
	return <> Vsco pics: {saves}</>;
}

VscoLoader.getInitialProps = async ({req}) => {
	const res = await fetch("");
	const json = await res.json();
	return {saves: json.vsco_saved_posts};
};

export default VscoLoader;
